import React from 'react';
import Style from '../Popup/Popup.module.css';
import { Text } from '../Text/Text';

export const Popup = ({message}) => {
    return (
        <div id={Style.popupContainer}>
            <div>
                <i class="fa-solid fa-check"></i>
            </div>
            <div>
                <Text>Added Successfully</Text>
            </div>
        </div>
    )
}
